"use strict";(self.webpackChunk_map_colonies_developer_portal=self.webpackChunk_map_colonies_developer_portal||[]).push([[4816],{80103:e=>{e.exports=JSON.parse('{"label":"API","permalink":"/developer-portal/pr-preview/pr-79/docs/tags/api","allTagsPath":"/developer-portal/pr-preview/pr-79/docs/tags","count":27,"items":[{"id":"MapColonies/3D/services/catalog/3d-catalog-service","title":"3D Catalog \ud83d\uddc3\ufe0f","description":"Catalog Service for the Web (CSW) is a standard for exposing a catalog of geospatial records in XML on the Internet (over HTTP). The catalog is made up of records that describe geospatial data, geospatial services (e.g. WMTS), and related resources.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/3D/services/catalog/3d-catalog"},{"id":"MapColonies/3D/services/3d-tile-server","title":"3D Tile Model Server","description":"Hardware Acceleration for WebGL / WebGL2 is crucial for 3D tiles rendering performance. for more information click here.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/3D/services/3d-tile-server"},{"id":"MapColonies/openstreetmap/nominatim/osm-nominatim-address","title":"Address Lookup API","description":"The lookup API allows to query the address and other details of one or","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/nominatim/Osm-AddressLookup-API"},{"id":"MapColonies/MapColonies-api-auth","title":"Authentication","description":"MapColonies API Auth Convention","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/authentication"},{"id":"MapColonies/DEM/Services/catalog/dem-catalog-service","title":"Catalog \ud83d\uddc3\ufe0f","description":"Catalogue Service for the Web (CSW) is a standard for exposing a catalogue of geospatial records in XML on the Internet (over HTTP). The catalogue is made up of records that describe geospatial data, geospatial services (e.g. WMTS), and related resources.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/DEM/Services/catalog/dem-catalog"},{"id":"MapColonies/Raster/services/catalog/raster-catalog-service","title":"Catalog \ud83d\uddc3\ufe0f","description":"Discover all availabale raster layers","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/Raster/services/catalog/raster-catalog-service"},{"id":"ogc/protocols/ogc-csw/ogc-csw","title":"CSW - Catalog Service for the Web","description":"Catalog Web Service","permalink":"/developer-portal/pr-preview/pr-79/docs/ogc/protocols/ogc-csw/ogc-csw"},{"id":"MapColonies/DEM/Services/elevation/dem-elevation-service","title":"Elevation \u26f0\ufe0f","description":"Service to return geographic coordinate [lat, lon] elevation","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/DEM/Services/elevation/info"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-expansion","title":"Expansion API","description":"Routing algorithms find the best path by expanding their search from start nodes/edges across the routing network until the destination is reached (unidirectional) or both search branches meet (bidirectional).","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-expansion"},{"id":"MapColonies/Raster/services/raster-export-service","title":"Export \ud83d\udce6","description":"Export map data","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/Raster/services/raster-export"},{"id":"MapColonies/openstreetmap/nominatim/osm-nominatim-faq","title":"FAQ","description":"API Results","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/nominatim/osm-nominatim-faq"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-isochrone","title":"Isochrone API","description":"An isochrone is a line that connects points of equal travel time about a given location, from the Greek roots of iso for equal and chrone for time. Valhalla\'s isochrone service computes areas that are reachable within specified time intervals from a location, and returns the reachable regions as contours of polygons or lines that you can display on a map.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-isochrone"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-locate","title":"Locate API","description":"Valhalla\'s locate service, is an open-source service that provides detailed information about streets and intersections close to an input point with some added matching criteria. This allows for tight integration in routing and navigation applications on web or mobile.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-locate"},{"id":"MapColonies/Raster/services/raster-map-service","title":"Map \ud83d\uddfa\ufe0f","description":"The raster map service uses the WMTS protocol which is a READ-ONLY Web Map Tile Service.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/Raster/services/map-service"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-matrix","title":"Matrix API","description":"Valhalla\'s time-distance matrix service provides a quick computation of time and distance between a set of locations and returns them to you in the resulting matrix table.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-matrix"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-optimized-route","title":"Optimized Route API","description":"The Optimized Route service provides a quick computation of time and distance between a set of location sources and location targets and returns them in an optimized route order, along with the shape.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-optimized-route"},{"id":"MapColonies/openstreetmap/nominatim/osm-nominatim-output","title":"Output Formats","description":"The /reverse, /search and /lookup","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/nominatim/Osm-output-API"},{"id":"MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-overview","title":"Overview","description":"The Valhalla route service (a.k.a. turn-by-turn) is an open-source routing service that lets you integrate routing and navigation into a web or mobile application. The service works globally, and provides dynamic and customizable routing by driving, walking, bicycling, and using multimodal and transit options, with clear directions for maneuvers along the route.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-overview"},{"id":"MapColonies/vector/Services/vector-query-service","title":"Query \ud83d\udd0e","description":"Search, Filter and Aggregate vector layers","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/vector/Services/query"},{"id":"MapColonies/vector/Services/replication/vector-replication-service","title":"Replication \ud83d\udce6","description":"On-Prem vector layers replica","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/vector/Services/replication/info"},{"id":"MapColonies/openstreetmap/nominatim/osm-nominatim-reverse-geocoding","title":"Reverse GeoCoding API","description":"Reverse geocoding generates an address from a latitude and longitude.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/nominatim/Osm-Reverse-Search-API"},{"id":"MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-route","title":"Route API","description":"Valhalla\'s routing service (a.k.a. turn-by-turn), is an open-source routing service that lets you integrate routing and navigation into a web or mobile application.","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-route"},{"id":"MapColonies/openstreetmap/nominatim/osm-nominatim-search","title":"Search API","description":"The search API allows you to look up a location from a textual description","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/openstreetmap/nominatim/Osm-Search-API"},{"id":"MapColonies/vector/Services/vector-valhalla-service","title":"Valhalla \ud83e\udded","description":"Directions and isochrones by OSM","permalink":"/developer-portal/pr-preview/pr-79/docs/MapColonies/vector/Services/valhalla"},{"id":"ogc/protocols/ogc-wcs","title":"WCS - Web Coverage Service","description":"Coverage Web Service","permalink":"/developer-portal/pr-preview/pr-79/docs/ogc/protocols/ogc-wcs"},{"id":"ogc/protocols/ogc-wfs","title":"WFS - Web Feature Service","description":"Catalog Web Service","permalink":"/developer-portal/pr-preview/pr-79/docs/ogc/protocols/ogc-wfs"},{"id":"ogc/protocols/ogc-wmts","title":"WMTS - Web Map Tile Service","description":"Web Map Tile Service","permalink":"/developer-portal/pr-preview/pr-79/docs/ogc/protocols/ogc-wmts"}]}')}}]);